const CourseShow = () => {
  const classes = useStyles();

  return (
    <>
      <div>
        <CourseDescription />
      </div>
      <div className={classes.regularMarginTop}>
        <BooksTable />
      </div>
    </>
  );
};

export default CourseShow;
